import React, { Component } from 'react';


class ResultWeather extends Component{
    render(){
        return(
            <div className='result'>
                <div className="location"> <strong>Location: </strong>Cairo</div>
                <div className="temp">     <strong>Tempreture: </strong>Cairo</div>
                <div className="humidity"><strong>Humidity: </strong>Cairo</div>
                <div className="conditions"><strong>Conditions: </strong>Cairo</div>
            </div>
        )
    }
}


export default ResultWeather;
